  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Necedah NWR outlines
  Refuge accomplishments from August through October of 1939. The report begins by
  summarizing the weather conditions and water conditions during this period. Wildlife-
  including migratory birds, upland game birds, and predators- is also covered. The
  Refuge development and maintenance section discusses physical developments and plantings.
  Resource management is outlined; topics include grazing and haying. The public relations
  section of the report describes recreational uses, Refuge visitors, hunting, fishing,
  and violations. A plant list is attached.\",\n\t\"license_title\": \"License Not
